import React, {Component} from 'react';
import {Line} from 'react-chartjs-2';

class MinData extends Component{
    constructor(){
        super();
        this.state = {
            data: {
                labels: [],
                datasets: []
            }
        };
    }


    componentDidMount() {
      fetch('https://oko-api.herokuapp.com/dwelling/room/', {
        method: 'GET',
        headers: {
          //'Authorization': 'Token 53aaf969d1e6ee660f11a9cb99da97338232d86e'
        }
      }).then(resp => resp.json())
        .then(resp => this.setState({room: resp}))
        .catch(error => console.log(error))
    }



    render(){
        return(

            <div className="enContainer">

                  <Line
                    data={room.room_data[0].temperature}
                    options={{
                      title: {
                        display: true,
                        text: 'Fladan mätpunkt',
                        fontSize: 25
                      }
                    }}
                  />


            </div>
        )
    }
}
export default MinData;
